import React from 'react';
import {Link} from 'react-router-dom';

const FeaturedPostItem = (props) => {
	return (
		<li className="w-featured-post__item">
			<div className="w-featured-post__thumbnail">
				<img
					src={require('../../assets/img/dave-vW1TR9cBcSg-unsplash-min.jpg')}
					alt=""
					className="w-featured-post__img"
				/>
			</div>
			<header className="w-featured-post__header">
				<a href="#" className="w-featured-post__item-title"><span
						>{props.title}</span></a>
				<span className="w-featured-post__item-date">August 8, 2019</span>
			</header>
		</li>
	)
}

export default FeaturedPostItem;
